import React from 'react';
import { Container} from 'react-bootstrap';
import NavbarButom from '../components/NavbarButom';

const HomePage = () => {
  
   const h1Style = {
              textTransform: "uppercase",
              fontFamily: "Anton, sans-serif",
              transform: "perspective(2000px) rotateY(-30deg)",
              transformOrigin: "center right",
              lineHeight: 1,
              letterSpacing: "-0.01em",
              fontSize: "8.5rem",
              color: "#000",
              textShadow: "2px 2px 0 #fff",
              wordWrap: "break-word",
  };
  return (
  <div
      style={{
        backgroundColor: "#3500ff",
        minHeight: "100vh",
        color: "white",
        padding: "2rem",
        overflow: "hidden",
        position: "relative",
      }}
    >
      <Container fluid >
        <Container fluid >
          <div style={{ position: "relative", zIndex: 2 }}>
            <div>
              <h1 className="text-end fw-bold" style={h1Style}>
               Studio<br />Mega
              </h1>
            </div>
          </div>
        </Container>
      <div
        style={{
          position: 'fixed',
          bottom: 80,
          left: 40,
          zIndex: 1000,
        }}
      >
         <div>
              <h1 className='' style={{ fontWeight: '900', lineHeight: '0.8', fontSize: '3rem' }}>VAN<br />HOLTZ<br />CO.</h1>
            </div>
        <NavbarButom />
        </div>
      </Container>
    </div>
  );
};

export default HomePage;
